<script>

    jQuery(document).ready(function(){




        jQuery('#devisautos_garantie').change(function(){

            if(jQuery(this).val() == 'Tout risque'){

                jQuery('#devisautos_vols').prop('checked', true);
                jQuery('#devisautos_incendies').prop('checked', true);
                jQuery('#devisautos_bris').prop('checked', true);

                jQuery(\"#devisautos_vols\").attr(\"disabled\", true);
                jQuery(\"#devisautos_incendies\").attr(\"disabled\", true);
                jQuery(\"#devisautos_bris\").attr(\"disabled\", true);

            } else{
                jQuery('#devisautos_vols').prop('checked', false);
                jQuery('#devisautos_incendies').prop('checked', false);
                jQuery('#devisautos_bris').prop('checked', false);


            }


        });

        jQuery(\".valeurVehicule\").keyup(function(event){
            var val = jQuery(this).val();
            if (val.length > 4){
                val = val.substring(0, val.length - 1);
                jQuery(this).val(val);
                jQuery(this).focus();
                return false;
            }
        });


        jQuery('.valeurVehicule').change(function() {
            jQuery(this).val() * 10000;
        });
        jQuery('#devisautos_garantie').change(function() {
            var \$option = jQuery(this).find('option:selected');

            //Added with the EDIT
            var value = \$option.val(); //returns the value of the selected option.
            var text = \$option.text(); //returns the text of the selected option.


        });
        jQuery('#devisautos_assistance1').change(function() {
            var \$option = jQuery(this).find('option:selected');

            //Added with the EDIT
            var value = \$option.val(); //returns the value of the selected option.
            var text = \$option.text(); //returns the text of the selected option.


            if(value == 'assistance2'){
                jQuery('#devisautos_assistance2').prop('checked', true);
            }else{
                jQuery('#devisautos_assistance2').prop('checked', false);
            }


            if(value == 'assistance3'){
                jQuery('#devisautos_assistance3').prop('checked', true);
            }else{
                jQuery('#devisautos_assistance3').prop('checked', false);
            }
        });






    });
</script>

